  \"2016-07-27T22:56:54.724666\",\n\t\"name\": \"department-of-the-interior-environmental-assessment-public-deer-hunting-on-back-bay-nation\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U. S. Fish and Wildlife Service proposes
  to initiate an annual public hunt for white-tailed deer on Back Bay National Wildlife
  Refuge. It is the purpose of the hunting program to reduce the deer herd, maintain
  the population at a level commensurate with the carrying capacity of the habitat
  and to providea quality outdoor recreational experience for a specific number of
  hunters.  This Environmental Assessment evaluates the initiation of public deer
  hunting as a means of keeping wildlife populations inbalance with the Back Bay habitat,
  while providing significant public outdoor recreational benefits.\",\n\t\"license_title\":
